import React from "react";

import Card from "../components/card";
import FormGroup from "../components/formGroup";

class CadastroUsuario extends React.Component {
    render(){
        return (
            <div className="container">
                <Card>
                    <div className="row">
                        <div className="col-lg-12">
                            <div className="bs-component">
                                <FormGroup htmlFor="exampleInputEmail1" label="Nome: *">
                                    <input type="email"
                                        value={this.state.email}
                                        onChange={e => this.setState({email: e.target.value})}
                                        className="form-control"
                                        id="exampleInputEmail1"
                                        aria-describedby="emailHelp"
                                        placeholder="Digite o Email" />
                                </FormGroup>
                                <FormGroup htmlFor="exampleInputEmail1" label="Email: *">
                                    <input type="email"
                                        value={this.state.email}
                                        onChange={e => this.setState({email: e.target.value})}
                                        className="form-control"
                                        id="exampleInputEmail1"
                                        aria-describedby="emailHelp"
                                        placeholder="Digite o Email" />
                                </FormGroup>
                                <FormGroup htmlFor="exampleInputEmail1" label="Senha: *">
                                    <input type="password"
                                        value={this.state.email}
                                        onChange={e => this.setState({email: e.target.value})}
                                        className="form-control"
                                        id="exampleInputEmail1"
                                        aria-describedby="emailHelp"
                                        placeholder="Password" />
                                </FormGroup>
                                <FormGroup htmlFor="exampleInputEmail1" label="Repita a senha: *">
                                    <input type="password"
                                        value={this.state.email}
                                        onChange={e => this.setState({email: e.target.value})}
                                        className="form-control"
                                        id="exampleInputEmail1"
                                        aria-describedby="emailHelp"
                                        placeholder="Password" />
                                </FormGroup>
                            </div>
                        </div>
                    </div>
                </Card>
            </div>
        );
    }
}

export default CadastroUsuario;
